// Click My Info
cy.visit('http://localhost/apps/orangehrm/web/index.php/pim/viewMyDetails');
// will be redirected to profile details screen
cy.url().should('contain', 'viewPersonalDetails');
// Fields are visible and enabled
// Details are visible
cy.get('[name="firstName"]').should('be.visible').should('have.value', 'Alexandrus');
cy.get('[name="lastName"]').should('be.visible').should('have.value', 'Maximus');
// Nationality        
cy.xpath('//label[contains(text(),"Nationality")]/parent::div/following-sibling::div/descendant::div[contains(text(),"American")]').should('be.visible');
// Gender
cy.xpath('//input[@type="radio"][@value="1"]').should('exist').should('be.checked');
// Should be non-editable
// Employee ID, Drivers's License Number, and Date of Birth
// Not required so it can be blank
cy.xpath('//label[text()="Employee Id"]/parent::div/following-sibling::div/descendant::input').should('be.visible').should('be.disabled');
// Birth date
cy.xpath('//label[contains(text(),"Birth")]/parent::div/following-sibling::div/descendant::input').should('be.visible').should('be.disabled').should('have.value', '1982-09-24');
// Testing for another disabled field
// Drivers License, not required
cy.xpath('//label[text()="Driver\'s License Number"]/parent::div/following-sibling::div/descendant::input').should('be.visible').should('be.disabled');
// logout
cy.visit('http://localhost/apps/orangehrm/web/index.php/auth/logout');
